import React from 'react';
import CountResult from '../components/Count';
import Decrement from '../components/decrement';
import Increment from '../components/increment';

function CounterPage() {
	return (
		<>
			<CountResult />
			<Decrement />
			<Increment />
		</>
	);
}

export default CounterPage;
